import { Bars3Icon, HomeIcon, XMarkIcon } from '@heroicons/react/24/outline';
import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);
  const navigate = useNavigate();
  const isAuthenticated = !!localStorage.getItem('token');
  const user = JSON.parse(localStorage.getItem('user') || '{}');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  return (
    <nav className="bg-blue-600 text-white p-4 sticky top-0 z-50">
      <div className="container mx-auto flex justify-between items-center">
        {/* Adorable Logo */}
        <Link to="/" className="flex items-center space-x-2">
          <HomeIcon className="w-6 h-6 text-peach-400" />
          <span className="text-2xl font-pacifico bg-gradient-to-r from-peach-400 to-pink-400 bg-clip-text text-transparent">
            Cozy Corner
          </span>
        </Link>

        {/* Desktop Menu */}
        <div className="hidden md:flex space-x-4">
          <Link to="/" className="hover:text-peach-200">Home</Link>
          {isAuthenticated ? (
            <>
              {user.role === 'tenant' && <Link to="/tenant" className="hover:text-peach-200">Tenant Dashboard</Link>}
              {user.role === 'landlord' && <Link to="/landlord" className="hover:text-peach-200">Landlord Dashboard</Link>}
              {user.role === 'admin' && <Link to="/admin" className="hover:text-peach-200">Admin Dashboard</Link>}
              <Link to="/profile" className="hover:text-peach-200">Profile</Link>
              <button onClick={handleLogout} className="hover:text-peach-200">Logout</button>
            </>
          ) : (
            <>
              <Link to="/login" className="hover:text-peach-200">Login</Link>
              <Link to="/register" className="hover:text-peach-200">Register</Link>
            </>
          )}
          <Link to="/contact" className="hover:text-peach-200">Contact Us</Link>
        </div>

        {/* Mobile Menu Button */}
        <div className="md:hidden">
          <button onClick={() => setIsOpen(!isOpen)} aria-label="Toggle mobile menu">
            {isOpen ? <XMarkIcon className="h-6 w-6" /> : <Bars3Icon className="h-6 w-6" />}
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <div className="md:hidden mt-2 space-y-2 bg-blue-700 p-4 rounded-lg">
          <Link to="/" className="block hover:text-peach-200">Home</Link>
          {isAuthenticated ? (
            <>
              {user.role === 'tenant' && <Link to="/tenant" className="block hover:text-peach-200">Tenant Dashboard</Link>}
              {user.role === 'landlord' && <Link to="/landlord" className="block hover:text-peach-200">Landlord Dashboard</Link>}
              {user.role === 'admin' && <Link to="/admin" className="block hover:text-peach-200">Admin Dashboard</Link>}
              <Link to="/profile" className="block hover:text-peach-200">Profile</Link>
              <button onClick={handleLogout} className="block hover:text-peach-200">Logout</button>
            </>
          ) : (
            <>
              <Link to="/login" className="block hover:text-peach-200">Login</Link>
              <Link to="/register" className="block hover:text-peach-200">Register</Link>
            </>
          )}
          <Link to="/contact" className="block hover:text-peach-200">Contact Us</Link>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
